<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
    <meta http-equiv="Cache-Control" content="no-siteapp"/>
    <meta name="renderer" content="webkit">
    <title>敬请期待</title>
    <style>
        * {
            margin: 0;
            padding: 0;
        }

        body {
            font-size: 12px;
            color: #414040;
            background-color: #E6E6E6;
        }

        .net {
            width: 312px;
            height: 312px;
            margin: 68px auto 54px;
            background: url('data:image/png;base64,')
            center center no-repeat;
            background-size: 100% 100%;
        }

        div.p {
            line-height: 28px;
            font-size:28px;
            text-align: center;
            padding-bottom:32px;
        }





        @media only screen and (min-width: 640px) {
            .net{
                width: 312px;
                height: 312px;
            }
            div.p {
                line-height: 28px;
                font-size:28px;
            }
        }

        @media only screen and (min-width: 400px) and (max-width: 640px) {
            .net{
                width: 246px;
                height: 246px;
            }
            div.p {
                line-height: 24px;
                font-size:24px;
            }
        }

        @media only screen and (min-width: 360px) and (max-width: 400px) {
            .net{
                width: 232px;
                height: 232px;
            }
            div.p {
                line-height: 20px;
                font-size:20px;
            }
        }

        @media only screen and (min-width: 321px) and (max-width: 360px) {
            .net{
                width: 212px;
                height: 212px;
            }
            div.p {
                line-height: 18px;
                font-size:18px;
            }
        }

        @media only screen and (max-width: 320px) {
            .net{
                width: 200px;
                height: 200px;
            }
            div.p {
                line-height: 16px;
                font-size:16px;
            }
        }
    </style>
</head>
<body>
<div class="content">
    <div class="net"></div>
    <div class="p">
        更多功能，敬请期待
    </div>
</div>
</body>
</html>